import React from "react";
import "./App.css";

import { Header } from "./component/Header";
import BalanceComponet from "./component/BalanceComponet";
import IncomeExpense from "./component/IncomeExpense";
import History from "./component/History";

function App() {
  return (
    <div>
      <Header />
      <BalanceComponet />
      <IncomeExpense />
      <History />
    </div>
  );
}

export default App;
